import styles from "./App.module.scss";
import { NavBar } from "./components/NavBar/NavBar";
import { Brand } from "./components/Brand/Brand";
import {Contact} from "./components/Contact/Contact";

const App = () => {
  return (
    <>
      <body>
        <header className={styles.App}>
          <NavBar />
        </header>
        <div>
          <Brand />
        </div>
      </body>
    </>
  );
};

export default App;
